import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import { Provider } from 'react-redux';
import { getStore } from './store';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
// import { SignIn } from './pages';
import { Overview, PackagePage, AccountInformation, Store, Advertisement, RechargePackage } from './pages';
import { Account } from './pages/account';
import './assets/less/style.scss';
import { SnackbarMessage } from './components';

const globalTheme = createMuiTheme({
	palette: {
		primary: {
			main: '#41D157',
		},
		secondary: {
			main: '#212530',
		},
	},
	overrides: {
		MuiTextField: {
			root: {
				width: '100%',
			},
		},
		MuiButton: {
			sizeLarge: {
				height: 50,
				fontSize: '1em',
				minWidth: 150,
			},
		},
		MuiAccordionSummary: {
			root: {
				'&.Mui-expanded': {
					minHeight: '0',
				},
				borderTop: '3px solid #3c8dbc',
				boxShadow: '0 1px 1px rgba(0,0,0,0.1)',
			},
			content: {
				'&.Mui-expanded': {
					margin: '10px 0',
				},
				margin: '10px 0',
			},
		},
	},
});

const App = () => {
	return (
		<MuiThemeProvider theme={globalTheme}>
			<Provider store={getStore({})}>
				<Router>
					<SnackbarMessage />
					<Switch>
						<Route exact path='/' component={Overview} />
						<Route path='/account-information' component={AccountInformation} />
						<Route path='/account' component={Account} />
						<Route path='/package' component={PackagePage} />
						<Route path='/store' component={Store} />
						<Route path='/advertisement' component={Advertisement} />
						<Route path='/advertisement' component={Advertisement} />
					</Switch>
				</Router>
			</Provider>
		</MuiThemeProvider>
	);
};

export default App;
